import React from "react";


function BabyNamesList(props){
  console.log(props);
    return (
      <div>
        {props.data.map((babyName) => (
          <ul>
            <li key = {babyName.id}>{babyName.sex === babyName.name}</li>
          </ul>
        ))}
      </div>
    );
}

export default BabyNamesList;
